errors:
удачно вийті замуж - вдало вийти заміж; планірують - планують; замуж - заміж; Нашо - Нащо; шо - що; планіруванні - плануванні; прорабом - виконробом; моно-бровою - монобровою; гопнікам - гопникам; чєму же - чому ж; всьо понятно, якшо шо - все зрозуміло, якщо що; гопніків - гопників; Насправді, - Насправді; блистить - блищить; лучче - краще; в своїй - у своїй; Дєвочки, ну шо ви прям як еті самі - Дівчата, ну що ви прямо, як ці самі; Спокойной ночі - На добраніч;
повезло - пощастило; продавщицю - продавчиню; дєвушка, вам памочь? - дівчино, вам допомогти?; продавщицями - продавчинями; їх актуальних - їхніх актуальних;
в тварини - у тварини; ергономічною упаковкою - ергономічним упакованням; нагло - нахабно
